INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 16, 2, 155, "人助けが大好き！　前向き格闘娘", 100101, "トゥインクルウィッシュ", "獣人族", "東山奈央", "ヒヨリ", "人助け、応援", 8, 27, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 17, 2, 158, "戦闘のサポートが得意な、心優しい少女", 100201, "トゥインクルウィッシュ", "ヒューマン", "種田梨沙", "ユイ", "料理、人間観察", 4, 5, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 18, 2, 163, "クールで何事にも真っ直ぐな剣士", 100301, "トゥインクルウィッシュ", "魔族", "早見沙織", "レイ", "読書、乗馬、お茶", 1, 12, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 27, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 9, 5, 128, "探検好きのイタズラっ子", 100401, "リトルリリカル", "ヒューマン", "諸星すみれ", "ミソギ", "いたずら、探検", 8, 10, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 40, "？？？", 12, 8, 146, "ヒーローに憧れる騎士見習いの少女", 100501, "王宮騎士団（NIGHTMARE）", "獣人族", "下田麻美", "マツリ", "ヒーローごっこ", 11, 25, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 42, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 13, 7, 150, "甘え上手なみんなの人気者", 100601, "悪魔偽王国軍（ディアボロス）", "魔族", "浅倉杏美", "アカリ", "サックス", 11, 22, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 14, 7, 130, "プリン大好きゴースト娘", 100701, "悪魔偽王国軍（ディアボロス）", "魔族", "雨宮天", "ミヤコ", "プリンを食べること", 1, 23, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 40, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 14, 15, 150, "ボクは誰よりも美しい", 100801, "ヴァイスフリューゲル　ランドソル支部", "エルフ", "大空直美", "ユキ", "鏡で自分を見ること", 10, 10, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 45, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 17, 13, 159, "前世を信じる中二病患者、「疾風の冥姫」", 100901, "トワイライトキャラバン", "魔族", "髙野麻美", "アンナ", "小説執筆", 7, 5, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 16, 10, 155, "マホマホ王国のプリンセス", 101001, "自警団（カォン）", "獣人族", "内田真礼", "マホ", "空想、ぬいぐるみ集め", 9, 22, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 44, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 15, 3, 156, "人懐っこくてマシンガントークな妹系少女", 101101, "ラビリンス", "ヒューマン", "阿澄佳奈", "リノ", "お裁縫", 8, 25, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 46, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 17, 6, 156, "みんなのために超能力を使う眠り姫", 101201, "フォレスティエ", "エルフ", "大橋彩香", "ハツネ", "妹と遊ぶこと、二度寝、昼寝、早寝", 12, 24, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 55, "", 18, 13, 166, "オタク全開な魔法少女", 101301, "トワイライトキャラバン", "魔族", "佳村はるか", "ナナカ", "読書、魔法", 8, 21, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 41, "test", 15, 10, 152, "頭脳明晰な美少女名探偵", 101401, "自警団（カォン）", "獣人族", "水瀬いのり", "カスミ", "読書、推理", 11, 3, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 54, "test", 21, 6, 165, "母性溢れる優しいみんなの「ミサト先生」", 101501, "フォレスティエ", "エルフ", "國府田マリ子", "ミサト", "絵本作り", 9, 5, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 48, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 18, 14, 167, "天真爛漫で人気者のカリスマモデル", 101601, "ルーセント学院", "魔族", "上坂すみれ", "スズナ", "ファッション", 4, 10, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 53, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 19, 10, 158, "いつでも「なんくるないさ～」な天然娘", 101701, "自警団（カォン）", "獣人族", "高森奈津美", "カオリ", "踊り、空手", 7, 7, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 52, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 23, 14, 162, "多くの男性を魅了する無垢な女教師", 101801, "ルーセント学院", "魔族", "伊藤静", "イオ", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 8, 14, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 21, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 10, 5, 117, "お歌もにんじんも、ウサギさんも大好き♪", 102001, "リトルリリカル", "獣人族", "日高里菜", "ミミ", "かわいいもの集め", 4, 3, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 12, 9, 150, "泣き虫で臆病な守ってあげたい女の子", 102101, "サレンディア救護院", "ヒューマン", "植田佳奈", "クルミ", "観劇、おままごと", 6, 9, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 40, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 13, 7, 150, "人見知りであまのじゃくな女の子", 102201, "悪魔偽王国軍（ディアボロス）", "魔族", "原紗友里", "ヨリ", "ゲーム全般", 11, 22, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 14, 9, 148, "ぷうきちといつも一緒！", 102301, "サレンディア救護院", "ヒューマン", "芹澤優", "アヤネ", "屋内でできる遊び", 5, 10, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 15, 9, 154, "お嬢さまのためにがんばるドジっ娘メイド", 102501, "サレンディア救護院", "ヒューマン", "悠木碧", "スズメ", "ご奉仕", 12, 12, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 42, "test", 17, 11, 144, "遊びと睡眠が何より大事なぐうたら娘", 102601, "牧場（エリザベスパーク）", "獣人族", "小岩井ことり", "リン", "あんパン", 1, 1, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 16, 13, 154, "運命の相手に一途すぎる乙女", 102701, "トワイライトキャラバン", "魔族", "橋本ちなみ", "エリコ", "実験、裁縫、料理", 7, 30, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 43, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 17, 9, 156, "救護院を経営する優しい庶民派お嬢様", 102801, "サレンディア救護院", "エルフ", "堀江由衣", "サレン", "経営、お茶会", 10, 4, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 40, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 17, 4, 157, "歌って踊れる大人気アイドル", 102901, "カルミナ", "ヒューマン", "日笠陽子", "ノゾミ", "舞台鑑賞、ダンス", 1, 24, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 16, 15, 163, "トーゴクの神秘、オシエテクダサイ！", 103001, "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "佐藤聡美", "ニノン", "忍法開発", 8, 31, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 18, 7, 157, "占いが得意な霊能少女", 103101, "悪魔偽王国軍（ディアボロス）", "魔族", "大坪由佳", "シノブ", "占い", 12, 22, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 45, "この私とともにいる限り、\nお金に不自由はさせませんわ！", 18, 12, 157, "一人前の商人を目指すパワフルお嬢様", 103201, "メルクリウス財団", "ヒューマン", "松嵜麗", "アキノ", "慈善事業", 3, 12, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 35, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 20, 11, 142, "みんなを笑顔にするお笑い牧場主", 103301, "牧場（エリザベスパーク）", "ヒューマン", "新田恵海", "マヒル", "漫才", 3, 3, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 55, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 22, 12, 164, "純情でほっとけない大人の女性", 103401, "メルクリウス財団", "エルフ", "今井麻美", "ユカリ", "ウインドーショッピング", 3, 16, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 21, "test", 8, 5, 118, "礼儀正しくしっかり者のちびっ子優等生", 103601, "リトルリリカル", "エルフ", "小倉唯", "キョウカ", "お勉強", 2, 2, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 43, "test", 13, 8, 149, "義理堅くてからかい好きな剣術少女", 103701, "王宮騎士団（NIGHTMARE）", "ヒューマン", "茅原実里", "トモ", "剣術、年長者をからかう", 8, 11, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 40, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 14, 11, 153, "読書が趣味の病弱少女", 103801, "牧場（エリザベスパーク）", "獣人族", "小清水亜美", "シオリ", "読書、お散歩", 11, 3, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 44, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 13, 6, 158, "「友達」に憧れる、エルフの森の女の子", 104001, "フォレスティエ", "エルフ", "花澤香菜", "アオイ", "友達作りのイメトレ", 6, 6, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 17, 4, 163, "人々を守るために歌う、唱喚士の少女", 104201, "カルミナ", "ヒューマン", "福原綾香", "チカ", "各種楽器", 6, 3, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 54, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 17, 10, 168, "男勝りで情に厚いワイルド娘", 104301, "自警団（カォン）", "獣人族", "小松未可子", "マコト", "お菓子作り", 8, 9, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 50, "test", "??", 7, 172, "かつては夜を支配した最強の吸血鬼", 104401, "悪魔偽王国軍（ディアボロス）", "魔族", "丹下桜", "イリヤ", "世界征服", 5, 5, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 18, 15, 157, "妄想大好き！　ほんとは照れ屋な女の子", 104501, "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "長妻樹里", "クウカ", "小説を読むこと", 11, 19, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 18, 12, 158, "弱きを助け強きをくじく猫娘", 104601, "メルクリウス財団", "獣人族", "沼倉愛美", "タマキ", "猫とたわむれること", 3, 1, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 50, "？？？", 25, 8, 171, "素顔を見せない冷静沈着な女性騎士", 104701, "王宮騎士団（NIGHTMARE）", "ヒューマン", "川澄綾子", "ジュン", "格闘技、湯浴み", 10, 25, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 20, 12, 163, "仕事も私事も効率優先な傭兵少女", 104801, "メルクリウス財団", "ヒューマン", "田所あずさ", "ミフユ", "傭兵などのアルバイト", 11, 11, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 18, 3, 168, "お姉ちゃんがお世話してあげるからねっ！", 104901, "ラビリンス", "ヒューマン", "生天目仁美", "シズル", "家事全般", 10, 24, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 22, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 11, 14, 120, "ちょっとおませな恋に恋する女の子", 105001, "ルーセント学院", "魔族", "久野美咲", "ミサキ", "ファッション誌鑑賞、コスメ集め", 1, 3, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 53, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", 27, 13, 166, "実験が趣味の危険な科学者", 105101, "トワイライトキャラバン", "ヒューマン", "三石琴乃", "ミツキ", "研究、実験", 3, 7, 0);
