INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 18, 12, 158, "弱きを助け強きをくじく猫娘", 107901, "メルクリウス財団", "獣人族", "沼倉愛美", "タマキ（サマー）", "猫とたわむれること", 3, 1, 0);
