INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 17, 4, 163, "人々を守るために歌う、唱喚士の少女", 108401, "カルミナ", "ヒューマン", "福原綾香", "チカ（クリスマス）", "各種楽器", 6, 3, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 12, 9, 150, "泣き虫で臆病な守ってあげたい女の子", 108501, "サレンディア救護院", "ヒューマン", "植田佳奈", "クルミ（クリスマス）", "観劇、おままごと", 6, 9, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 14, 9, 148, "ぷうきちといつも一緒！", 108601, "サレンディア救護院", "ヒューマン", "芹澤優", "アヤネ（クリスマス）", "屋内でできる遊び", 5, 10, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 16, 2, 155, "人助けが大好き！　前向き格闘娘", 108701, "トゥインクルウィッシュ", "獣人族", "東山奈央", "ヒヨリ（ニューイヤー）", "人助け、応援", 8, 27, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 17, 2, 158, "戦闘のサポートが得意な、心優しい少女", 108801, "トゥインクルウィッシュ", "ヒューマン", "種田梨沙", "ユイ（ニューイヤー）", "料理、人間観察", 4, 5, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 18, 2, 163, "クールで何事にも真っ直ぐな剣士", 108901, "トゥインクルウィッシュ", "魔族", "早見沙織", "レイ（ニューイヤー）", "読書、乗馬、お茶", 1, 12, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 16, 13, 154, "運命の相手に一途すぎる乙女", 109001, "トワイライトキャラバン", "魔族", "橋本ちなみ", "エリコ（バレンタイン）", "実験、裁縫、料理", 7, 30, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 18, 3, 168, "お姉ちゃんがお世話してあげるからねっ！", 109101, "ラビリンス", "ヒューマン", "生天目仁美", "シズル（バレンタイン）", "家事全般", 10, 24, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 55, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 17, "", 156, "英霊と契約を結んだマナリアの天才王女", 109201, "？？？", "ヒューマン", "日笠陽子", "アン", "読書", 12, 1, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 45, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 15, "", 144, "マナリア魔法学院の新入生", 109301, "？？？", "ヒューマン", "こやまきみこ", "ルゥ", "食べること、眠ること", 2, 4, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 67, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 17, "", 167, "人を超越した力を有す心優しい竜姫", 109401, "？？？", "半人半竜", "福原綾香", "グレア", "ピアノ", 11, 3, 0);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 18, 15, 157, "妄想大好き！　ほんとは照れ屋な女の子", 109501, "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "長妻樹里", "クウカ（オーエド）", "小説を読むこと", 11, 19, 0);
